  <style>
    @font-face {
        font-family: "Maison Neue";
        font-weight: 700;
        src: url("MaisonNeue-Bold.ttf");
    }
    @font-face {
        font-family: "Maison Neue";

    @font-face {

    @font-face {
        font-family: "Sweet Sans Pro";
        font-weight: 700;

    }

    body {
        padding: 0;
        margin: 0;
    }
    svg {
        position: relative;
    }
    #Knob {
        cursor: grab; 
    }
    #Value-Indicator {
        transition: transform 0.3s ease-out;
    }
    #Slider-Fill {
        transition: transform 0.3s ease-out;
    }
    body.is-adjusting {
        cursor: grabbing;
    }
    body.is-adjusting #Value-Indicator {
        transition: none;
    }
    body.is-adjusting #Slider-Fill {
        transition: none;
    }
    body.is-adjusting #Knob {
        cursor: grabbing;
    }
    #Drag-handles {
        pointer-events: none;
    }
    .button {
        cursor: pointer;
    }
    #Carbon-Bubbles > circle {
        transition: transform 0.3s ease-out;
        transform: translateY(0px);
    }
    #Carbon-Bubbles > circle.sequestered {
        transform: translateY(1000px);
    }
  </style>
